async function Dashboard() {
	const user = useUser();
	const { _id } = user;

	const [token, setToken] = useToken();

	const userInfo = await axios.get(`/users/${_id}`).catch((err) => {
		console.log(err);
	});

	return (
		<div>
			<div></div>
		</div>
	);
}

export default Dashboard;
